    [],nt"revision_timestamp": "2016-08-02T03:00:52.841347",nt"name": "physical-and-underway-data-collected-aboard-the-thomas-g-thompson-during-cruise-tn270-in-the-co",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0104369 includes chemical,
    optical and other data collected aboard the THOMAS G. THOMPSON during cruise TN270
    in the Coastal Waters of SE Alaska and North Pacific Ocean from 2011-09-01 to 2011-10-21.
    These data include Attenuation/Transmission, CONDUCTIVITY, CURRENT SPEED - EAST/WEST
    COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), DEPTH - BOTTOM, DEPTH
    - OBSERVATION, DISSOLVED OXYGEN, FLUORESCENCE, HYDROSTATIC PRESSURE, SALINITY and
    WATER TEMPERATURE. The instruments used to collect these data include ADCP, CTD,
    GPS, echo sounder, fluorometer, oxygen meter and transmissometer. These data were
    collected by William Wilcock of University of Washington, Janet Newton of University
    of Washington; Applied Physics Laboratory, Charles Nittrouer of University of Washington,
    Elizabeth Armbrust of University of Washington, Paul Quay of University of Washington,
    Miles Logsdon of University of Washington, Kristian Haapa-aho of University of Washington
    and Mikelle Nuwer of University of Washington as part of Student Cruise. The Lamont-Doherty
    Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
    Rolling Deck to Repository (R2R) program.nnThe CTD data submitted by the originator
    represent the raw data suite. Processed versions of the data were generated by NODC.
    The ADCP data represent the raw and automated processed data set. Post processed
    quality assessed data are not available in this accession.",nt"license_title":
